      out.write("\t\t\t\t\t</div>\r\n");
      out.write("\t\t\t\t\t<div class=\"box-content\">\r\n");
      out.write("\t\t\t\t\t\t<h1>说明 <small></small></h1>\r\n");
      out.write("\t\t\t\t\t\t<p>\r\n");
      out.write("\t\t\t\t\t\t· 会员资料必须认真填写如果出现错误将影响到奖金以及发货.<br/>\r\n");
      out.write("\r\n");
      out.write("\t\t\t\t\t\t· 新会员的资料註册后的初始密码是证件的后6位，注册后请立即修改.<br/>\r\n");
      out.write("\t\t\t\t\t\t\r\n");
      out.write("\t\t\t\t\t\t· 新会员註册后只是註册会员如果要成为正式会员必须： 购买产品.<br/>\r\n");
      out.write("\t\t\t\t\t\t\r\n");
      out.write("\t\t\t\t\t\t· 购买产品等工作由正式会员代理完成.<br/>\r\n");
      out.write("\t\t\t\t\t\t\r\n");
      out.write("\t\t\t\t\t\t· 註册会员可以修改其所有资料，当成为正式会员后将不能更改“会员用户名”、“推荐人用户名”.<br/>\r\n");
      out.write("\t\t\t\t\t\t\r\n");
      out.write("\t\t\t\t\t\t· 会员资料修改：修改未购货激活的注册会员资料.<br/>\r\n");
      out.write("\t\t\t\t\t\t\r\n");
      out.write("\t\t\t\t\t\t· 删除资料修改：删除未购货激活的注册会员资料. <br/>\r\n");
      out.write("\t\t\t\t\t\t\r\n");
      out.write("\t\t\t\t\t\t</p>\r\n");
      out.write("\t\t\t\t\t\t\r\n");
      out.write("\t\t\t\t\t\t<h1>注册条款 <small></small></h1>\r\n");
      out.write("\t\t\t\t\t\t<p>\r\n");
      out.write("\t\t\t\t\t\t1、 我已达法定年龄。我了解并同意作为一位会员，应遵行”SL会员商城”的政策和守则，对自己决定的时间和一切产品及健康宣导及行销活动负责。<br/>\r\n");
      out.write("\r\n");
      out.write(" \r\n");
      out.write("\r\n");
      out.write("\t\t\t\t\t\t2、我十分了解向潜在的会员展示奖金和预测高额的收入是被禁止的行为，“”可以据此终止我的会员资格。<br/>\r\n");
      out.write("\r\n");
      out.write(" \r\n");
      out.write("\r\n");
      out.write("\t\t\t\t\t\t3、作为会员，我将维护并提升“SL会员商城”的产品和声誉；不进行有损“SL会员商城”之声誉、产品或公共利益的行为，否则将被终止会员资格，SL会员商城还将保留其他法律措施。<br/>\r\n");
      out.write("\r\n");
      out.write(" \r\n");
      out.write("\r\n");
      out.write("\t\t\t\t\t\t4、任何参与之个人或法人团体可以各自拥有一个会员资格。一旦正式成为会员就不能变动。<br/>\r\n");
      out.write("\r\n");
      out.write(" \r\n");
      out.write("\r\n");
      out.write("\t\t\t\t\t\t5、我了解我将负责零售及批发的记录，这些记录将作为公司要求的评价和核实材料。在向潜在的会员或顾客展示“SL会员商城”的事业机会或产品时，我同意必须如实的介绍公司、产品、事业机会，不得夸大或做失实的介绍，否则我可能被终止会员资格 。<br/>\r\n");
      out.write("\r\n");
      out.write(" \r\n");
      out.write("\r\n");
      out.write("\t\t\t\t\t\t6、公司将根据市场的变化保持可行的市场行销计画，将不定期的对会员增列有关的条款和条件，公司政策、程式、市场计划的修改和所有的变更，将视为在“SL会员商城”正式网站上所发布的协议部份之一。<br/>\r\n");
      out.write("\r\n");
      out.write(" \r\n");
      out.write("\r\n");
      out.write("\t\t\t\t\t\t7、我了解并同意我有责任随时保持知悉“SL会员商城”所有当前最新的资讯，如果我没有这样做，“SL会员商城”对我忽略正确资讯的后果不负任何责任。<br/>\r\n");
      out.write("\r\n");
      out.write(" \r\n");
      out.write("\r\n");
      out.write("\t\t\t\t\t\t8、我了解并确认公司没有做出任何有关收入之保证，利润保证或向我展示任何成功的事例。除了此处的声明外，公司没有对我做出任何口头或书面的担保或保证。“SL会员商城”并不建议任何可能的会员离开当前的职业，或在他们产品销售的零售交易带来稳定、可观的收入之前，即购买大量的产品。<br/>\r\n");
      out.write("\r\n");
